  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kenai National
  Moose Range and Tuxedni National Wildlife Refuge outlines Refuge accomplishments
  during the 1979 calendar year. The report begins with an introduction to the Refuge
  and information about weather conditions, habitat conditions, land acquisition activities,
  and the system status. Construction, maintenance, and wildfires are also described.
  Habitat management is covered; wetlands, forests, and wilderness areas are discussed.
  The wildlife section of the report discusses migratory birds, mammals, and non-migratory
  birds. Interpretation and recreation activities are outlined; topics include information
  and interpretation, recreation, and law enforcement. Field investigations, cooperative
  programs, items of interest, and safety information are attached.\",\n\t\"owner_org\":
